import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faDumbbell, faSyncAlt } from "@fortawesome/free-solid-svg-icons";

const UserGrid = ({ workouts }) => {
  return (
    <div className="user-grid">
      <h2>Your Workouts....</h2>
      <table>
        <thead>
          <tr>
            <th>
              <FontAwesomeIcon icon={faDumbbell} /> Load (kg)
            </th>
            <th>
              <FontAwesomeIcon icon={faSyncAlt} /> Reps
            </th>
          </tr>
        </thead>
        <tbody>
          {workouts.length > 0 ? (
            workouts.map((workout) => (
              <tr key={workout._id}>
                <td>{workout.title}</td>
                <td>{workout.load}</td>
                <td>{workout.reps}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="3">No workouts found.</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default UserGrid;
